func lexicographicallySmallestArray(nums []int, limit int) []int {
    changed := true
    for changed {
        changed = false
        for i := 0; i < len(nums); i++ {
            minIndex, minValue := i, nums[i]
            for j := i + 1; j < len(nums) && j <= i+limit; j++ {
                if abs(nums[i]-nums[j]) <= limit && nums[j] < minValue {
                    minIndex, minValue = j, nums[j]
                    changed = true
                }
            }
            if minIndex != i {
                nums[i], nums[minIndex] = nums[minIndex], nums[i]
                break
            }
        }
    }
    return nums
}

func abs(x int) int {
    if x < 0 {
        return -x
    }
    return x
}
